import React from 'react';

import './App.css';
import {tweets} from '../../constants';
import Tweet from '../../components/Tweet';


console.log(tweets);
const App = () => (

    tweets.map((tweet, index) =>
            <Tweet
                key = {index}
                avatar =  {tweet.avatar}
                fullname = {tweet.fullname}
                date = {tweet.date}
                content = {tweet.content} 

            
            />

        )


    
);

export default App;
